import { ColumnNumber, FirstColumn, DataColumn, CommentColumn, Thead } from "./Table.style";
import { DataGrid } from "@mui/x-data-grid";
import { Icon, IconAbsolute } from "./IconComponent/Icon";
import { TableStatus } from "../constants/TableType";
import { FC } from "react";
import { TableBody } from "./TableBody";
import { COLORS } from "../constants/colors";
export type TableProps = {
  rows: RowType[];
};
export type RowType = {
  children: boolean;
  numberContract: string;
  startDate: number;
  finalDate: number;
  comments?: CommentsProps;
  status: TableStatus;
  proceed: string;
  download: string;
};
export type CommentsProps = {
  name: string;
  date: number;
  comments: string[];
};
type CommentProps = {
  comment: string;
};

export const Table: FC<TableProps> = ({ rows }) => {
  return (
    <>
      <table
        style={{
          borderRadius: "10px",
          // border: "1px solid black",
          margin: "20px",
          padding: 0,
          borderCollapse: "collapse",
        }}>
        <div
          style={{
            borderRadius: "inherit",
            boxSizing: "border-box",
            width: "100%",
          }}>
          <Thead>
            <tr>
              <th style={{ borderTopLeftRadius: "10px" }}>
                <FirstColumn></FirstColumn>
              </th>

              <th>
                <ColumnNumber style={{ justifyContent: "space-between" }}>
                  № договора
                  <div style={{ display: "flex", flexDirection: "column" }}>
                    <Icon type="IconUp" />
                    <Icon type="IconDown" />
                  </div>
                  <IconAbsolute type="Divider" />
                </ColumnNumber>
              </th>

              <th>
                <DataColumn>
                  Дата создания <IconAbsolute type="Divider" />
                </DataColumn>
              </th>
              <th>
                <DataColumn>
                  Дата окончания <IconAbsolute type="Divider" />
                </DataColumn>
              </th>
              <th>
                <CommentColumn>
                  Комментарии <IconAbsolute type="Divider" />
                </CommentColumn>
              </th>
              <th>
                <ColumnNumber>
                  Статус <IconAbsolute type="Divider" />{" "}
                </ColumnNumber>
              </th>
              <th style={{ borderTopRightRadius: "10px" }}>
                <ColumnNumber>Действие</ColumnNumber>
              </th>
            </tr>
          </Thead>
          <tbody>
            {rows.map((row) => (
              <TableBody {...row} />
            ))}
          </tbody>
        </div>
      </table>
    </>
  );
};
